class Enemy extends Animation{constructor(i,t,s,h,e,a,p,d,r,o){super(i,t,s,h,e,a,p,d),this.originalX=s,this.originalSpeed=r,this.speed=r,this.delay=o,this.hasCollided=!1,this.initialY=height-this.characterHeight-this.offsetY,this.y=this.initialY,this.floor=this.initialY,this.jumpSpeed=0,this.gravity=2,this.hasJumped=!1}setSpeed(i){this.speed=i}move(){this.x=this.x-this.speed,this.x<-this.characterWidth-this.delay&&(this.x=width)}stop(){this.x<-this.characterWidth&&this.setSpeed(0)}restart(){this.x=this.originalX,this.setSpeed(this.originalSpeed),this.animate()}jump(){this.jumpSpeed=-30}applyGravity(){this.y=this.y+this.jumpSpeed,this.jumpSpeed=this.jumpSpeed+this.gravity,this.y>this.floor&&(this.y=this.floor,this.jumpCount=0)}}